import React from "react";

const Search = (props) => {
  //  console.log(props)
  return (
    <div className="search-right" style={{color:"black" , display:"grid"}}>
      <img src={props.value.img} alt="" className="img"  style={{width:"50%" }}></img>
      <br />
      <b>Name: </b>
      {props.value.name}
      <br />
      <b>Location: </b>
      {props.value.location}
      <br />
      <b>Size: </b>
      {props.value.size}
      <br />
      <b>Price: </b>
      {props.value.price}
    </div>
  );
};
export default Search;
